import Box from '@mui/material/Box';
import React from 'react'

const Main = () => {
  return (
    <div>
     <Box
      sx={{
        width: 600,
        height: 50,
        backgroundColor: 'primary.dark',
        '&:hover': {
          backgroundColor: 'primary.main',
          opacity: [0.9, 0.8, 0.7],
        },
      }}
    />

    </div>
  )
}

export default Main
